import React, { useState} from 'react';
import './App.css';
import {
  BrowserRouter as Router,Switch,Route,Link,Redirect
} from "react-router-dom";
import {
  Navbar, NavbarBrand,Nav,NavLink,
} from 'reactstrap';
import Home from './Home';
import Jupiter from './Jupiter';
import Explore from './Explore';

function App(){
  return (
    <Router>
      <div>
        <Switch>
            <Route path="/explore">
              <Explore />
            </Route>
            <Route path="/jupiter">
              <Jupiter/>
            </Route>
            <Route path="/discover">
              <Discover/>
            </Route>
            <Route path="/">
              <Home/>
            </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Navig(){
  var logo = {
    width: "180px"
  };
  return (
        <Navbar expand="md">
          <NavbarBrand><Link to="/"><img src="/rockarocket-logo-white.png" style={logo}/></Link></NavbarBrand>
            <Nav className="mr-auto" navbar>
            </Nav>
            <NavLink><Link to="/explore">Explore</Link></NavLink>
            <NavLink><Link to="/discover">Get Inspired</Link></NavLink>
            <NavLink href="#">Log In</NavLink>
        </Navbar>
  )
}

function Discover(){
  return (
    <div className="background-disc">
      <Navig />
    </div>
  )
}

export default App;
